
import { jsPDF } from "jspdf";
import toBase64QR from '@/qrcode-generator'

function createDoc(options) {
    const doc = jsPDF(options);
    doc.addFileToVFS('Mohave.ttf', '');
    doc.addFileToVFS('Mohave-Bold.ttf', '');
    doc.addFont('Mohave.ttf', 'Mohave', 'normal');
    doc.addFont('Mohave-Bold.ttf', 'Mohave', 'bold');
    doc.setFont('Mohave', 'normal');
    return doc;
}

function addText(doc, x, y, label, text, fontSize) {
    doc.setFontSize(7).setFont('Mohave', 'normal')
        .text(label, x, y - 2.5, { baseline: 'top' })
        .setFontSize(fontSize).setFont('Mohave', 'bold')
        .text(text, x, y, { baseline: 'top' })
}

function abbreviate(text, length) {
    return text.substring(0,length) + (text.length > length ? '...' : '');
}

export function downloadPIDLabels(pidLabelData) {
    const labels = pidLabelData;
    const doc = createDoc({
        format: [57.5, 100],
        orientation: 'l'
    });

    for (let i = 0; i < labels.length; i += 1) {
        const row = labels[i];
        const qr = toBase64QR(labels[i].code.code);
        const partNoFontSize = Math.min(330 / row.partNo.length, 27);
        const supplierIDFontSize = Math.min(6 * 30 / row.supplierID.length, 26)
        qr.then((qrResult) => {
            doc
                .rect(1, 1, 98, 55.5, 'S') // main box
                .line(34, 13, 99, 13, 'S') // 1st horizontal line
                .line(34, 25, 99, 25, 'S') // 2nd horizontal line
                .line(1, 34, 99, 34, 'S') // 3nd horizontal line
                .line(1, 41, 99, 41, 'S') // 4th horizontal line
                .line(1, 49, 99, 49, 'S') // 5th horizontal line

                .line(34, 41, 34, 56.5, 'S') // 1st vertical line (parting columns in the bottom area)
                .line(34, 1, 34, 34, 'S') // 2nd vertical line
                .line(48, 34, 48, 41, 'S') // 2nd vertical line
                .line(63, 13, 63, 25, 'S') // 3rd vertical line (parting Qty and SupplierID)
                .line(72, 41, 72, 56.5, 'S') // 4th vertical line (parting columns in the bottom area)

            addText(doc, 34.5, 4, "Part No:", row.partNo, partNoFontSize)
            addText(doc, 34.5, 16, "Quantity:", row.qty.toString(), 26)
            addText(doc, 63.5, 16, "Supplier ID:", row.supplierID, supplierIDFontSize)
            addText(doc, 34.5, 28, "Supplier Name:", abbreviate(row.supplierName, 25), 14)
            addText(doc, 1.5, 37, "ASN:", row.asnNo ?? '-', 11)
            addText(doc, 48.5, 37, "Description:", abbreviate(row.description ?? '-', 27), 11)
            addText(doc, 1.5, 44, "Date Received:", row.dateRecieved.substring(0, 10), 11)
            addText(doc, 1.5, 52, "Job No:", row.inboundJobNo, 11)
            addText(doc, 34.5, 44, row.controlCode1Header + ':', row.controlCode1, 11)
            addText(doc, 34.5, 52, "PID:", row.pid, 11)
            addText(doc, 72.5, 44, row.controlCode2Header + ':', row.controlCode2, 11)
            addText(doc, 72.5, 52, "Customer:", row.customerID, 11)
            // qr code
            doc.addImage(qrResult, 'png', 2, 2, 31, 31);

            if (i < labels.length - 1) doc.addPage();
            if (i == labels.length - 1) doc.save('labels.pdf');
        })
    }

}

export function downloadGIDLabels(gidLabelData) {
    const labels = gidLabelData;
    const doc = createDoc({
        format: [57.5, 100],
        orientation: 'l'
    });

    for (let i = 0; i < labels.length; i += 1) {
        const row = labels[i];
        const qr = toBase64QR(row.code.code);
        const whsFontSize = Math.min(6 * 30 / row.whsCode.length, 26);
        const nameFontSize = Math.min(6 * 55 / row.name.length, 26);
        qr.then((qrResult) => {
            doc
                .rect(1, 1, 98, 55.5, 'S') // main box
                .line(42.5, 15, 99, 15, 'S') // 1st horizontal line
                .line(42.5, 28.75, 99, 28.75, 'S') // 2nd horizontal line
                .line(1, 42.5, 99, 42.5, 'S') // 4th horizontal line

                .line(71.5, 15, 71.5, 28.75, 'S') // 1st vertical line (parting columns in the bottom area)
                .line(42.5, 1, 42.5, 42.5, 'S') // 2nd vertical line

            addText(doc, 43, 4, "Name:", row.name, nameFontSize)
            addText(doc, 43, 18, "Quantity:", row.qty.toString(), 26)
            addText(doc, 72, 18, "WHS:", row.whsCode, whsFontSize)
            addText(doc, 43, 31.75, "Created date:", row.createdDate.substring(0, 10), 26)
            addText(doc, 1.5, 45.5, "Group ID:", row.gid, 27)

            // qr code
            doc.addImage(qrResult, 'png', 2, 2, 39.5, 39.5);

            if (i < labels.length - 1) doc.addPage();
            if (i == labels.length - 1) doc.save('gidLabels.pdf');
        })
    }

}

export function downloadLocationLabels(locationLabelData) {
    const labels = locationLabelData;
    const doc = createDoc({
        format: [55, 100],
        orientation: 'l'
    });

    for (let i = 0; i < labels.length; i += 1) {
        const row = labels[i];
        const qr = toBase64QR(row.qrCode);
        const codeFontSize = Math.min(8 * 60 / row.code.length, 46);
        qr.then((qrResult) => {
            doc.rect(1, 1, 98, 53, 'S') // main box
               .line(1, 25, 99, 25, 'S') // 1st horizontal line

            addText(doc, 2, 4, "", row.code, codeFontSize)
            addText(doc, 2, 26, "", "LOCATION", 20)
            addText(doc, 2, 34, "", "WHS: ", 20)
            addText(doc, 18, 33, "", row.whsCode, 36)

            // qr code
            doc.addImage(qrResult, 'png', 71, 26, 27, 27);

            if (i < labels.length - 1) doc.addPage();
            if (i == labels.length - 1) doc.save('locationLabels.pdf');
        })
    }
}